import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

import {NavBar} from 'interra-data-catalog-components'


import Home from "./Home"
import Search from "./Search"
import CDataset from "./CDataset";

import { css } from '../node_modules/bootstrap/dist/css/bootstrap.min.css';

import Theme from './theme/default'
import { ThemeProvider } from 'styled-components'
import GlobalStyles from './theme/globalStyles';


class App extends Component {

  render() {

      const home =   <Home />
      const search = <Search />

      return (
        <div>
        <GlobalStyles />
        <ThemeProvider theme={Theme}>
          <div className="App">
            <NavBar/>
            <Router>
              <div>
                <Route exact={true} path='/' render={()=>(home)} />
                <Route exact={true} path='/home' render={()=>(home)} />
                <Route exact={true} path='/search' render={()=>(search)}/>
                <Route exact={true} path='/dataset/:id' render={({match})=>(<CDataset id={match.params.id}/>)}/>
              </div>
            </Router>
          </div>
        </ThemeProvider>
        </div>
      );
  }
}

export default App;
